name: rsh

model_type: segmented_regression

segmentation_col: hedonic_sector_id

fit_filters:
- residential_units > 0
- sqft_per_unit > 0
- year_built > 1700
- stories > 0
- 1e1 < sqft_price_res < 1e6
- 81 <= building_type_id <= 84

predict_filters:
- residential_units > 0
- 81 <= building_type_id <= 84

min_segment_size: 10

default_config:
    model_expression: np.log1p(sqft_price_res) ~ b_ln_building_sqft + b_ln_parcel_sqft
        + b_ln_parcels_parcel_far + b_ln_sqft_per_unit + building_age + crime_other_rate
        + crime_ucr_rate + nodes_drv_drv_20min_pop + nodes_drv_elem_school_perf +
        nodes_walk_ave_lot_sqft + nodes_walk_ave_unit_sqft + nodes_walk_hhs_with_children
        + nodes_walk_highinc_hhs + nodes_walk_households + nodes_walk_percent_hh_with_children
        + nodes_walk_percent_low_income + nodes_walk_percent_race1 + nodes_walk_percent_race2
        + nodes_walk_percent_race3 + nodes_walk_quarter_mile_to_transit + nodes_walk_residential
        + nodes_walk_sum_nonresidential_units + parcels_total_job_spaces + stories
        + zones_a_ln_emp_26min_drive_alone + zones_a_ln_emp_50min_transit + zones_logsum_job_high_income
        + zones_logsum_job_low_income + zones_logsum_pop_high_income + zones_logsum_pop_low_income
        + zones_percent_vacant_residential_units + zones_transit_jobs_30min + zones_z_total_jobs
    ytransform: np.exp

